import { Route, Routes } from "react-router-dom";
import './App.css';
import Navbar from "./components/Navbar"
import Home from "./pages/"


function App() {
  return (
    <div>
       <Navbar/>

      <Routes>

        <Route path="/" element={<Home/>} />

      </Routes>

    </div>


  );
}

export default App;
